// Configuration
const SUPABASE_BASE_URL = $('Set Data').first().json.supabase_bucket_url;

// Get data
const uploadedImages = $('Final Set').item.json.images || [];
let { markdown } = $json;

// Process image replacements
const processedMarkdown = uploadedImages.reduce((md, image) => {
  const { original_id, file_name, image_annotation = '' } = image;
  const localPattern = `![${original_id}](${original_id})`;
  const hostedReplacement = `![${original_id}](${SUPABASE_BASE_URL}/${file_name})\n\n${image_annotation}`;

  return md.replaceAll(localPattern, hostedReplacement);
}, markdown);

return {
  json: {
    ...$json,
    markdown: processedMarkdown
  }
};
